func prettifyTyping(_ node: Typing) -> [String] {
  switch node {
    case let .ATyping(expr, type_):
      var result = [String]()
      result += prettifyExpr(expr)
      result += [":"]
      result += prettifyType(type_)
      return result
  }
}
